import React from 'react';
import { Col, Row } from 'antd';
import Header from '../Header/Index';
const Index = (props) => {
    return (
        <div>
            <Row>
                <Col flex={1}><Header e={6}/></Col>
                <Col flex={4}></Col>
            </Row>
        </div>
    );
}

export default Index;
